import React from "react";

const NavBar = ({ totalCounters }) => {
  return (
    <nav className="ll">
      <a className="navar-brand" href="http://localhost:3000">
        Navbar
        <span className="badge badge-pill badge-secondary m-2">
          {totalCounters}
        </span>
      </a>
    </nav>
  );
};

export default NavBar;
